import React from 'react';
import './App.scss';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Layout from "./components/page/Layout/Layout";

function App() {
    return (
        <div className="App">
            <div className="markup">
                <BrowserRouter>
                    <Routes>
                        <Route path='/' element={<Layout/>} />
                    </Routes>
                </BrowserRouter>
            </div>
        </div>
    );
}

export default App;
